import React from 'react';
import logo from './logo.svg';
import './App.css';


function App() {
  return (
    <div className="App">
      <form>
      <h1>Hello</h1>
      <p>Enter your name:</p>
      <input
        type='text'
		name='name'
      />
      </form>
    </div>
  );
}
export default App;
